import MotApp from "./MotApp";
const express = require("express");
const app = express();

app.get("/allow-cors", function (request, response) {
  response.set("Access-Control-Allow-Origin", "*");
  response.sendFile(__dirname + "/message.json");
});

function App() {
  return <MotApp />;
}

export default App;
